description:
A hodgepodge of bizarre scenes featuring insane people doing weird things. For example there are numerous shots of pigs, gory pig slaughters, a man pretending to be a chicken, a girl dragging said man, a girl dragging a dead chicken, many people in masks, the burning of a dead goat, the sitting next to people on a bench while a weirdo with a road sign runs past scene, the voyeuristic scene of a girl playing with herself, many weird people in bizarre costumes in alleys or hounding our main character in the street, etc. Supposedly about failed love and it may be saying something about foreigners and social-racial difficulties but what it really means is anyones guess. This is too incoherent to even be surreal.
